package com.corejava.basics;
import static java.lang.System.out;
public class StaticImportDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
          out.println(6+8);
          out.println(4-10);
          out.println(6*8);
          out.println((float)8/3);//Automatic conversion
          out.println(7%5);

	}

}
